(285, 'KU.03.1', '', 'Pendapatan meliputi naskah-naskah: a) Surat Setoran Pajak (SSP); b) Surat Setoran Bukan Pajak (SSBP); c) Bukti Penerimaan Negara Bukan Pajak (PNBP); d) Penerimaan Sisa Anggaran Lebih dan Saldo Kas atau Surat Setoran Pengembalian Belanja (SSPB); dan e) Bunga dan atau Jasa Giro Pos pada Bank.', '2021-04-24 13:04:38'),
(286, 'KU.03.2', '', 'Belanja meliputi naskah-naskah: a) Surat Penyedia Dana (SPP-UP, SPPDU/ TU, SPP-LS); b) Dokumen Belanja (Gaji, Honor, Perjalanan Dinas beserta data pendukung, SPP, SPM, SP2D); c) Dokumen Pelaksanaan Pengada-an Barang/Jasa Pemerintah (Barang Habis Pakai, Barang Inventaris, Jasa); d) Pembukuan Anggaran, mencakup: (1) Buku Kas Umum (BKU); (2) Buku Kas Pembantu (BKP); (3) Buku/Kartu Pengawasan Kredit Anggaran; dan (4) Rekening Koran; e) Daftar Gaji, Data Gaji, Laporan Pertanggungjawaban dari KPU RI, KPU Provinsi/KIP Aceh, dan KPU/KIP Kabupaten/Kota; f) Laporan Keuangan Bulanan/Triwulan/Semesteran/ Tahunan, mencakup: (1) Manual Implementasi Sistem Akuntansi Instansi (SAI); (2) Berita Acara Rekonsiliasi, Daftar Transaksi (DT); (3) Pengeluaran (PK); (4) Penerimaan (PN); (5) Dokumen Sumber (DS); (6) Bukti Jurnal (BJ); (7) Surat Tanda Setor (STS); (8) Surat Setor Bukan Pajak (SSBP); dan (9) Surat Perintah Pencairan Dana (SP2D); (10) SPM dalam daftar ringkasan pengembalian dan potongan dari pengeluaran (SPDR); (11) Laporan Realisasi Bulanan dan Laporan Tahunan mencakup: (a) Laporan realisasi anggaran (LRA); (b) Neraca; dan (c) Catatan atas Laporan keuangan.', '2021-04-24 13:04:38'),
